        <Door onClick={handleDoorClick} opacity={doorOpacity} />
        <Door onClick={handleDoorClick} opacity={doorOpacity} />
        <Door onClick={handleDoorClick} opacity={doorOpacity} />
      </div>
      {doorOpacity === 0 && <WrongKeyCentered />}
    </div>
  );
};

const Door = ({ onClick, opacity }) => {
  return (
    <div className='door-container' style={{ opacity: opacity, transition: 'opacity 0.2s' }} onClick={onClick}>
      <img src={door} alt='door' className='door' />
    </div>
  );
};

const DoorWithWrongKey = () => {
